TITLE:
  - Prestressing
PROBLEM TYPE:
  PROBLEMTYPE: "Structure"
IO:
  OUTPUT_SPRING: true
  STRUCT_STRESS: "Cauchy"
  STRUCT_STRAIN: "GL"
  WRITE_FINAL_STATE: true
  VERBOSITY: "Standard"
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 5
IO/RUNTIME VTK OUTPUT/STRUCTURE:
  OUTPUT_STRUCTURE: true
  DISPLACEMENT: true
  ELEMENT_OWNER: true
  STRESS_STRAIN: true
SOLVER 1:
  SOLVER: "Superlu"
  NAME: "Structure_Solver"
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "Statics"
  RESULTSEVERY: 5
  RESTARTEVERY: 5
  TIMESTEP: 0.1
  NUMSTEP: 50
  MAXTIME: 100
  TOLDISP: 1e-09
  TOLRES: 1e-09
  LOADLIN: true
  LINEAR_SOLVER: 1
STRUCT NOX/Printing:
  Inner Iteration: false
  Outer Iteration StatusTest: false
MATERIALS:
  - MAT: 1
    MAT_Mixture:
      NUMCONST: 2
      MATIDMIXTURERULE: 10
      MATIDSCONST: [11, 14]
  - MAT: 10
    MIX_GrowthRemodelMixtureRule:
      GROWTH_STRATEGY: 100
      DENS: 1
      NUMCONST: 2
      MASSFRAC: [0.5, 0.5]
  - MAT: 100
    MIX_GrowthStrategy_Isotropic: {}
  - MAT: 11
    MIX_Constituent_ExplicitRemodelFiber:
      FIBER_MATERIAL_ID: 110
      ENABLE_GROWTH: false
      DECAY_TIME: 1
      GROWTH_CONSTANT: 1
      DEPOSITION_STRETCH: 1.13
      INELASTIC_GROWTH: true
      INIT: 3
  - MAT: 110
    MIX_Constituent_RemodelFiber_Material_Exponential:
      K1: 10
      K2: 30
      COMPRESSION: false
  - MAT: 14
    MIX_Constituent_ElastHyper:
      NUMMAT: 2
      MATIDS: [141, 143]
      PRESTRESS_STRATEGY: 149
  - MAT: 141
    ELAST_IsoExpoPow:
      K1: 10
      K2: 10
      C: 1
  - MAT: 143
    ELAST_VolSussmanBathe:
      KAPPA: 100
  - MAT: 149
    MIX_Prestress_Strategy_Iterative:
      ACTIVE: false
FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "a"
  - VARIABLE: 0
    NAME: "a"
    TYPE: "linearinterpolation"
    NUMPOINTS: 3
    TIMES: [0, 1, 9.999999999e+09]
    VALUES: [1, 1.13, 1.13]
FUNCT2:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "a"
  - VARIABLE: 0
    NAME: "a"
    TYPE: "linearinterpolation"
    NUMPOINTS: 3
    TIMES: [0, 1, 9.999999999e+09]
    VALUES: [0, 1, 1]
DESIGN POINT DIRICH CONDITIONS:
